import React from 'react';
import { Container, Typography, Grid, Paper, Button, Box } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#1c1c1c',
      paper: '#2c2c2c',
    },
    text: {
      primary: '#ffffff',
    },
  },
});

function Showcase() {
return (
    <ThemeProvider theme={theme}>
        <Container maxWidth="lg" sx={{ mt: 4, textAlign: 'center' }}>
            <Typography variant="h3" gutterBottom>
                How FlipVault Works
            </Typography>
            <Typography variant="h6" gutterBottom>
                Discover the benefits of using FlipVault.
            </Typography>
            <Grid container spacing={4}>
                {[
                    {
                        title: 'Product Checks',
                        description: 'Have a database of 200 products at your disposal giving you the best chance of success.',
                    },
                    {
                        title: 'Feature 2',
                        description: 'Description of how Feature 2 works and its benefits.',
                    },
                    {
                        title: 'Feature 3',
                        description: 'Description of how Feature 3 works and its benefits.',
                    },
                ].map((feature, index) => (
                    <Grid item xs={12} md={4} key={index}>
                        <Paper sx={{ p: 3, backgroundColor: 'background.paper' }}>
                            <Typography variant="h5" gutterBottom>
                                {feature.title}
                            </Typography>
                            <Typography variant="body1" gutterBottom>
                                {feature.description}
                            </Typography>
                            <Button variant="outlined" color="inherit">
                                Learn More
                            </Button>
                        </Paper>
                    </Grid>
                ))}
            </Grid>
        </Container>
    </ThemeProvider>
);
}

export default Showcase;
